const data = [clover, cloud, circle, x];

const max = 12;

let particles = [];

class Ball {
  constructor(shape) {
    this.shape = $(shape);
    this.speed = 2 + Math.random() * 6;
    this.vx = Math.random() * this.speed - Math.random() * this.speed;
    this.vy = Math.random() * this.speed - Math.random() * this.speed;
    this.radius = 100 + Math.round(Math.random() * 100);
    this.w = $(window).width();
    this.h = $(window).height();
    this.x = (this.w - this.radius) / 2;
    this.y = (this.h - this.radius) / 2;

    $(window).on("resize", this.resize.bind(this));
    this.render();
  }

  render() {
    $(this.shape).css({
      width: this.radius,
      height: this.radius,
      position: "absolute",
      willChange: "transform"
    });
    $("#section1 .bg").append(this.shape);
  }

  resize() {
    this.w = $(window).width();
    this.h = $(window).height();
  }

  move() {
    this.x = this.x + this.vx;
    this.y = this.y + this.vy;

    this.shape.css({
      left: this.x,
      top: this.y,
      transform: "rotate(" + this.y + "deg)"
    });

    // 입자가 화면 경계를 넘지 않도록 처리
    if (this.x < 0) {
      this.x = 0;
      this.vx = -this.vx;
    } else if (this.x > this.w - this.radius) {
      this.x = this.w - this.radius;
      this.vx = -this.vx;
    }

    if (this.y < 0) {
      this.y = 0;
      this.vy = -this.vy;
    } else if (this.y > this.h - this.radius) {
      this.y = this.h - this.radius;
      this.vy = -this.vy;
    }

    if (this.x < 0 || this.x > this.w - this.radius) {
      this.vx = -this.vx;
    }
    if (this.y < 0 || this.y > this.h - this.radius) {
      this.vy = -this.vy;
    }
    return this;
  }
}

function randomInt(min, max) {
  return Math.floor(Math.random() * (max - min + 1) + min);
}

for (let i = 0; i < max; i++) {
  particles.push(new Ball(data[randomInt(0, data.length - 1)]));
}

function update() {
  particles = particles.filter((p) => p.move());
  requestAnimationFrame(update);
}
update();
